import React from 'react'
import { Card, CardHeader, CardBody, Box } from 'grommet';
import { Phone, User, Mail } from 'grommet-icons';

export default function ContactCard(props) {
    return (
        <Card flex height={'xsmall'} width={'medium'} background={'light-1'} justify='center' align='center'>
            <CardHeader pad="xxsmall">
                <Box direction='row' justify='center' align='center'>
                    <User />{props.name}
                </Box>
            </CardHeader>
            <CardBody pad="xxsmall">
                <Box flex direction='row' justify='around'>
                    <Box direction='row'><Phone />{props.phone}</Box>
                    <Box direction='row'><Mail />{props.email}</Box>
                </Box>
            </CardBody>
        </Card >
    )
}
